import React from "react";
import "./Common_Content_All.css";


function Commom_Content_All (){
    return(
       <div>
        <div>
        <img className="JSPL_LOGO"
           src={require('./jspl_logo.png')}
           alt="Jspl-logo"
        />
        </div>
        <div>
            <h2>Rake Management System</h2>
        </div>


       </div>
    );
}
  

export default Commom_Content_All;
